import React from 'react';
import {Link} from 'react-router-dom';


const Navbar = () => {
    return (
        <nav className="nav.nav-wrapper.grey.darken-3">
            <div className="container">
                <Link to='/' className="brand-logo">Notiplan</Link>
            </div>
        </nav>

    )
}

export default Navbar;
